columns_description:
The registration status of the attorney; valid values are:
•	Delinquent;
•	Deceased;
•	Incapacitated;
•	Resigned;
•	Resigned from bar - disciplinary reason;
•	Disbarred;
•	Due to Register;
•	Currently registered;
•	Due to reregister within 30 days of birthday;
•	Suspended.

COR = Corporate; 
HLT = Health; 
JUD = Chief Judge
